v role=presentation class={0}-bc><\/div><\/div><\/div>',KGd='<div role=presentation class={0}-ml><div role=presentation class={0}-mr><div role=presentation class={0}-mc><\/div><\/div><\/div>',JGd='<div role=presentation class={0}-tl><div role=presentation class={0}-tr><div role=presentation class={0}-tc><\/div><\/div><\/div>',MGd='<div role=presentation><table class={0} cellpadding=0 cellspacing=0 role=presentation><tbody role=presentation>',tWd="<iframe src=\"javascript:''\" name='",cXd="<img src='",cqe='<li>',Zoe="<p> For each pair of requirements, use the sliders to indicate which requirement you consider to be more <b>costly<\/b> and which you consider to be more <b>valuable<\/b> to the project's security.<\/p>",ehe='<p><ul><li>Provide a baseline set of categories. The team may have to suggest alternative categories, depending on the client project. <\/li><li>Facilitate the stakeholders categorization process. <\/li><\/ul><\/p>',kie='<p>A set of artifacts for the system, as complete as possible, has been generated by the requirements engineering team and shared with the stakeholders.<\/p>',pge='<p>A single business goal for the project and several prioritized security goals that support it have been established. The assets to be protected have also been identified and associated with the security goals.<\/p>',Pee='<p>A well-documented, agreed-on set of definitions has been established and is available to all stakeholders and the requirements engineering team. The definitions document will be used as a reference throughout the rest of the SQUARE process.<\/p>     ',Kpe='<p>All requirements have been prioritized.<\/p>',One='<p>All security requirements have been verified both by the requirements engineering team and the stakeholders. At this point the SQUARE process is complete, and the requirements engineering team can produce the final security requirements document for the stakeholders.<\/p>',cre='<p>All vulnerabilities and threats have been identified and classified according to their likelihood. The results are well documented and shared with the stakeholders.<\/p>   ',Dme='<p>An initial set of security requirements for the system has been elicited and documented. It is not necessary that the set be considered final or completely correct.<\/p>    ',pie='<p>Artifacts are generated outside of the tool but this tool will hold a reference (usually a hyperlink to an online repository) to all required artifacts.  This will make it easier to keep a record of the artifacts and versions of artifacts used to gather security requirements for the system.<\/p>',fre='<p>Assist requirements engineers by providing information about the project and participating in the risk elicitation process.<\/p>',lie='<p>Before the requirements engineering team and stakeholders can generate a comprehensive set of security requirements, the team must collect a complete set of artifacts of the system. The following are the types of artifacts that should be collected:<\/p><ul><li>System architecture diagrams<\/li><li>Use case scenarios/diagrams<\/li><li>Misuse case scenarios/diagrams<\/li><li>Attack trees<\/li><li>Standardized templates and forms<\/li><\/ul><p>In developing such artifacts, it is important to enlist the assistance of knowledgeable engineers from the organization. In some cases, it is possible that the client organization will not have any of the artifacts in place, including such basic items as system architecture diagrams. In such situations, the requirements engineering team should reiterate to the stakeholders that by creating and documenting artifacts of the system, they are investing in the success of the project.<\/p>',Rne='<p>Come to a consensus on the validity of each security requirement. Verify that each requirement is verifiable, in scope, within financial means, and feasible to implement. Requirements that do not fit these criteria should have been identified in earlier stages of SQUARE, but the stakeholders should use this opportunity as a last chance to remove any requirements from the working set.<\/p>  ',Qne='<p>Facilitate the inspection process by providing any orientation to the structured inspection technique or informal inspection guides such as checklists.<\/p> ',Mpe='<p>Facilitate the prioritization process with the stakeholders. If a structured prioritization process is selected, teach the stakeholders how to perform the process.<\/p>',nie='<p>Generate or collect any system artifacts and present them to the requirements engineering team. This information includes system architectures, actors, use/misuse cases, and suspected attacks. It is possible that other experts from within the organization may be called upon to provide information as well.  Stakeholders should also verify the accuracy and completeness of artifacts.<\/p>  ',Lpe='<p>In most cases, the client organization will be unable to implement all of the security requirements due to lack of time, resources, or developing changes in the goals of the project. Thus, the purpose of this step in the SQUARE process is to prioritize the security requirements so that the stakeholders can choose which requirements to implement and in what order. The results of Step 4, the risk assessment, and Step 7, categorization, are crucial inputs to this step.<\/p><p>The available prioritization methods are flexible and can be as simple as unstructured deliberation between the stakeholders. There are several structured prioritization techniques that exist, such as Triage, Win-Win, and the Analytical Hierarchy Process (AHP); the latter has been reported to be quite effective. Ideally, the requirements engineering team should also produce a cost-benefit analysis to aid the stakeholders\' decisions.<\/p><p>It may be the case that, during prioritization, some of the requirements may be deemed to be entirely infeasible to implement. In such cases, the requirements engineering team has a choice: completely dismiss the requirement from further consideration, or document the requirement as "future work" and remove it from the working set of project requirements. This decision should be made after consulting with the stakeholders.<\/p> ',Qee='<p>In order to guarantee effective and clear communication throughout the requirements engineering process, the requirements engineering team and stakeholders must first agree on a common set of terminology and definitions. <\/p><p>Given the differences in expertise, knowledge, and experience, an arbitrary term may have multiple meanings between the participants in the SQUARE process. In addition, there may be ambiguity in the level of detail that is assumed for a given term. For instance, one stakeholder may view "access controls" as a set of policies that governs which users may be granted access to which resources. Another stakeholder may view access controls as the software elements in the system that actually implement this functionality. These differences in perspective must be resolved before the process can continue. <\/p> ',Zde="<p>In the tool, a requirements engineer will assign values to rate each technique in terms of the given evaluation criteria.  The tool will use this information to generate a comparison matrix and recommend the technique to be used.  The Lead Requirements Engineer may modify the techniques and evaluation criteria for the project from the Project's settings dashboard.<\/p>",Tne='<p>Inspection is a powerful tool that is often skipped due to the perception that it is a wasted time.  This tool provides resources and acts as a checkpoint that must be passed in order to download the final requirements list.<\/p>',Npe='<p>Prioritize the security requirements using the risk assessment and categorization results as a basis for decision making.<\/p>  ',fhe='<p>Reach a consensus on the categorization for each requirement.<\/p> ',Ime='<p>Requirements will be collected in the tool and information for linking requirements for traceability purposes will also be solicited.  The tool also provides an easy means for reviewing the collected requirements.<\/p>',Yde='<p>Stakeholders may review the selection and assist the requirements engineers but otherwise have no responsibilities in this step.<\/p>',Ppe='<p>The AHP can be a tedious and error-prone method without the help of automation.  The SQUARE Tool will automatically calculate the priority matrix based on inputs and determine the security requirement priorities.<\/p>',che='<p>The initial set of requirements has been organized into project-defined categories, and any remaining architectural constraints are identified as such.<\/p>    ',Pne='<p>The last step of the SQUARE process, requirements inspection, is one of the most important elements in creating a set of accurate and verifiable security requirements. Inspection can be done at varying levels of formality, from Fagan Inspections to peer reviews. The goal of any inspection method, however, is to find any defects in the requirements such as ambiguities, inconsistencies, or mistaken assumptions.<\/p><p>See information on <a href="http://en.wikipedia.org/wiki/Fagan_inspection">Fagan Inspection<\/a> and <a href="http://www.amazon.com/gp/product/0201734850?ie=UTF8&tag=nevletdowdotn-20&linkCode=as2&camp=1789&creative=390957&creativeASIN=0201734850">Peer Reviews in Software by Karl Wiegers<\/a> for more information on inspections.<\/p>',qge='<p>The purpose of Step 2 in SQUARE is for the stakeholders to formally agree on a set of prioritized security goals and assets to be protected for the project. Without overall security goals for the project, it is impossible to identify the priority and relevance of any security requirements that are generated. In addition, the establishment of security goals scopes the rest of the SQUARE process.<\/p><p>Initially, different stakeholders will likely have different security goals, and different views of the important assets to be protected. For example, a member of human resources may be concerned about maintaining the confidentiality of personnel records, whereas a stakeholder in finance may be concerned with ensuring that financial data is not modified without authorization. The security goals of the stakeholders may also conflict with one another. A security-conscious stakeholder may place high importance on strong security controls for the system, which in turn may hamper overall system performance. Decreased performance might likely be at odds with the goals of the marketing department. This step in the SQUARE process serves to eliminate such conflicts and align all of the stakeholders\' interests.<\/p><p>The security goals of the project must be in clear support of the project\'s overall business goal, which also must be identified in this step. On average, stakeholders should attempt to brainstorm to come up with approximately half a dozen security goals for the project, with more or less depending on the scale of the project. The assets and the security goals are mapped to one another, but not necessarily in a one-to-one manner. That is several security goals may be associated with a single asset, and several assets may be protected by a single security goal.<\/p><p>Once the goals of the various stakeholders have been identified, they must be prioritized. In the absence of consensus, an executive decision may be needed to prioritize the goals. The assets to be protected must be identified and associated with the security goals.  Some iteration may be needed to complete this.  Finally, the requirements engineering team must encourage the stakeholders to generate security goals as opposed to requirements or recommendations. There is a fine line between a security goal such as "The system shall be available for use when needed," a requirement such as "The system must have a continuity of operations plan in place to ensure appropriate system availability," and a recommendation such as "Invest in backup information technology hardware to ensure business continuity." The requirements engineering team must act as the experts in this situation, providing assistance to the stakeholders so that they may generate an appropriately scoped set of security requirements.<\/p> ',dre='<p>The purpose of this step in the SQUARE process is to identify the vulnerabilities and threats that face the system, as well as the likelihood that the threats will materialize as real attacks. Without a risk assessment, organizations can be tempted to implement security requirements or countermeasures without a logical rationale. For instance, the stakeholders may decide that encryption is a necessary component of their system without fully understanding the nature of the problem that encryption can solve. The risk assessment also serves to prioritize the security requirements at a later stage in the process.<\/p><p>There are a growing number of risk assessment methods from which to choose. Some of the methods are very structured and may require the assistance of an external risk expert. Ideally, this expert would already be a part of the project team.<\/p><p>After the threats have been identified by the risk assessment method, they must be classified according to likelihood. Again, this will aid in prioritizing the security requirements that are generated at a later stage.<\/p>',dhe='<p>The purpose of this step is to allow the requirements engineer and stakeholders to classify the requirements as essential, non-essential, system level, software level, or as architectural constraints. The requirements engineering team can provide to the stakeholders a matrix such as the one in Table 4 to assist in this process.<\/p><p>The categories in Table 4 are not fixed; each iteration of SQUARE will likely produce a much larger set of categories that are customized to the project at hand. These categories are instead suggested as a minimal set.<\/p><p>Since the goal of SQUARE is to produce security requirements, the requirements engineering team and stakeholders should avoid producing architectural constraints. Architectural constraints are provided as a category here to serve as an outlet for requirements that, upon categorization, are considered to be constraints. Ideally, such anomalies would be identified and corrected in the previous steps of the process.<\/p><p>Once the requirements are categorized, the requirements engineering team and stakeholders will be able to prioritize them more efficiently.<\/p> ',Vde='<p>The requirements engineering team has selected an appropriate elicitation technique and documented the rationale for their choice.<\/p>  ',Wde='<p>The requirements engineering team must select an elicitation technique that is suitable for the client organization and project. Although this task may appear to be straightforward, it is often the case that multiple techniques will likely work for the same project. The difficulty is in choosing a technique that can adapt to the number and expertise of stakeholders, size and scope of the client project, and expertise of the requirements engineering team. It is extremely unlikely that any single technique will work for all projects under all circumstances, though previous experience has shown that the Accelerated Requirements Method (ARM) has been successful in eliciting security requirements. This particular technique is discussed further in Section 4.7.2 of the <a href="http://www.sei.cmu.edu/publications/documents/05.reports/05tr009.html" target="new">Security Quality Requirements Engineering (SQUARE) Methodology report from the Software Engineering Institute<\/a>.<\/p><p>The following is a sample of elicitation techniques that may be appropriate:<ul><li>Structured/unstructured interviews<\/li><li>Use/misuse cases<\/li><li>Joint Application Development<\/li><li>Accelerated Requirements Method<\/li><li>Soft Systems Methodology<\/li><li>Issue-Based Information Systems<\/li><li>Quality Function Deployment<\/li><li>Feature-Oriented Domain Analysis<\/li><li>Controlled Requirements Expression<\/li><li>Critical Discourse Analysis<\/li><li>Privacy Requirements Elicitation Method<\/li><\/ul><\/p>',Eme='<p>This step is the heart of the SQUARE process: the elicitation of security requirements. To the benefit of the requirements engineering team, most elicitation techniques provide detailed guidance on how to perform the elicitation, so this step is simply a matter of executing the technique. However, even if the stakeholders are very knowledgeable about the project and communicate effectively, it can be challenging for the requirements engineering team to elicit correct requirements. <\/p><p>Perhaps the largest mistake that the requirements engineering team can make in this step is to elicit non-verifiable or vague, ambiguous requirements. Each requirement must be stated in a manner that will allow relatively easy verification once the project has been implemented. For instance, the requirement "The system shall improve the availability of the existing customer service center" is impossible to measure objectively. Instead, the requirements engineering team should encourage the production of requirements that are clearly verifiable and, where appropriate, quantifiable. A better version of the previously stated requirement would thus be "The system shall handle at least 300 simultaneous connections to the customer service center".<\/p><p>A second mistake that the requirements engineering team can make in this step is to elicit implementations or architectural constraints instead of requirements. Requirements are concerned with what the system should do, not how it should be done.<\/p><p>All elicitation techniques will probably involve face-to-face interaction with the stakeholders, so it is also the responsibility of the requirements engineering team to make logistical arrangements with the stakeholders and inform them of the amount of time they can expect to spend in this part of the SQUARE process.<\/p>',gre='<p>This tool assumes the NIST risk assessment process will be used to analyze risks <a href="http://csrc.nist.gov/publications/nistpubs/800-30/sp800-30.pdf">(PDF)<\/a>. Since only the final risks are recorded in the tool by the requirements engineers, any risk process might be used.  While recording risks in the tool, the risks will be traced to assets and goals to assist with later analysis.<\/p>',hhe='<p>This tool uses  "tagging" to make it easy to quickly add requirements to a variety of categories.<\/p>',tge='<p>This tool will help you link goals and assets.  The tool will also perform checks to ensure that all goals have at least one asset.  By saving information in this tool, automated analysis options will become available as more information is collected.<\/p>',Uee='<p>This tool will store an easily referable list of terms and definitions that will form a common vocabulary throughout the execution of the SQUARE Method.<\/p>',mie='<p>Work with the stakeholders and client organization to identify and collect as many artifacts as possible.  The requirements engineering team should also verify the accuracy and completeness of artifacts.<\/p> ',VXd='<strong>',YGd='<table cellpadding=0 cellspacing=0>',QGd='<table class={0} cellpadding=0 cellspacing=0 role=presentation><tbody role=presentation>',ZGd='<tbody><tr><td><div class=my-treetbl-indent><\/div><\/td>',XGd='<td class=my-treetbl-cell index=0><div class=my-treetbl-cell-overflow><div class=my-treetbl-cell-text>',aHd='<td class=my-treetbl-check><div class=my-treetbl-notchecked><\/div><\/td>',bHd='<td class=my-treetbl-icon><div>&nbsp;<\/div><\/td>',cHd='<td class=my-treetbl-item-text><span>{0}<\/span><\/td>',$Gd='<td class=my-treetbl-joint align=center valign=middle><div>&nbsp;<\/div><\/td>',_Gd='<td class=my-treetbl-left><div><\/div><\/td>',dHd='<td class=my-treetbl-right><div><\/div><\/td><\/tr><\/tbody><\/table><\/div><\/div><\/td><\/tr><\/tbody><\/table><\/div>',TGd='<tr class={0}-brow role=presentation><td class={0}-bl role=presentation><\/td><td class={0}-bc role=presentation><\/td><td class={0}-br role=presentation><\/td><\/tr>',RGd='<tr class={0}-trow role=presentation><td class={0}-tl role=presentation><div role=presentation>&nbsp;<\/div><\/td><td class={0}-tc role=presentation><\/td><td class={0}-tr role=presentation><div role=presentation>&nbsp;<\/div><\/td><\/tr>',SGd='<tr role=presentation><td class={0}-ml role=presentation><\/td><td class={0}-mc role=presentation><\/td><td class={0}-mr role=presentation><\/td><\/tr>',OGd='<tr><td class={0}-bl role=presentation><div role=presentation><\/div><\/td><td class={0}-bc role=presentation><\/td><td class={0}-br role=presentation><div role=presentation><\/div><\/td><\/tr>',NGd='<tr><td class={0}-ml role=presentation><div role=presentation><\/div><\/td><td class={0}-mc role=presentation><\/td><td class={0}-mr role=presentation><div role=presentation><\/div><\/td><\/tr>',bqe='<ul>',Fme='<ul><li>Execute the elicitation technique chosen in Step 5. This may entail a large amount of logistical preparation and orientation for the stakeholders. Stakeholders should be informed of the amount of time they can be expected to spend during this step of the process. <\/li><li>Document the requirements as they are collected. <\/li><li>Encourage the generation of verifiable, preferably quantifiable security requirements.<\/li><\/ul>',rge="<ul><li>Facilitate the brainstorm session by the stakeholders, emphasizing the importance of creating a single business goal, followed by several security goals that support it. Assets should be identified in conjunction with security goals.<\/li><li>Review the stakeholders' business and security goals, and assets, providing any feedback on scope, level of detail, and relevance to the business goal of the project.<\/li><li>Document and share the finalized business goal and corresponding security goals and assets.<\/li><\/ul>",ere='<ul><li>Facilitate the completion of a structured risk assessment, likely performed by an external risk expert.<\/li><li>Review the results of the risk assessment and share them with stakeholder<\/li><\/ul>',Gme='<ul><li>Follow the instructions given by the requirements engineering team during the elicitation process.<\/li><li>Encourage the generation of verifiable, preferably quantifiable security requirements.<\/li><\/ul> ',sge='<ul><li>Identify a single business goal for the project. This goal should be stated in one sentence, such as the system shall provide the means to effectively manage company resources in a disaster situation.<\/li><li>Brainstorm and create approximately half a dozen security goals that are in clear support of the business goal. For example, the system shall maintain high availability, even in the face of public utility failures.<\/li><li>Prioritize the security goals.<\/li><li>Identify the assets to be protected in conjunction with the security goals.<\/li><li>Provide the business goal, security goals, and assets to the requirements engineering team for review, and edit the goals and assets as deemed necessary by the team.<\/li><\/ul>',Ree='<ul><li>Provide an initial set of terms with corresponding suggested definitions. Facilitate the process of stakeholder review of these terms. <\/li><li>When the stakeholders have reviewed all terms, one team member should mark each term as "confirmed." <\/li><li>Establish a single point of contact (POC) for interaction between the requirements engineering team and the stakeholders.<\/li><\/ul> ',Xde='<ul><li>Select an elicitation technique that is appropriate for the number and expertise of stake-holders, size and scope of the project, and expertise of the requirements engineering team.<\/li><li>Document the rationale for the choice and make necessary preparations to execute the technique.<\/li><\/ul> ',See='<ul><li>Use this tool to identify security terms and definitions provided by the requirements engineering team. All stakeholders should come up to speed on each defin
